function friendView() {
    const friendViewModel = FriendViewModel.getInstance();
    const friendList = friendViewModel.getFriendList().map((data, i) => {
    return (
    <Link to="chat" key={i}>
        <li>
            <img src={UserDefaultImg}/>
        </li>
    </Link>
    )});

    return (
        <>
            <Header title={'친구'} placeholder={"이름 검색"}/>
